@prefix skolem: <http://eyereasoner.github.io/.well-known/genid/8b98b360-9a70-4845-b52c-c675af60ad01#>.
@prefix r: <http://www.w3.org/2000/10/swap/reason#>.
@prefix var: <http://www.w3.org/2000/10/swap/var#>.
@prefix list: <http://www.w3.org/2000/10/swap/list#>.
@prefix string: <http://www.w3.org/2000/10/swap/string#>.
@prefix seq: <http://eyereasoner.github.io/eye/reasoning/seq#>.
@prefix n3: <http://www.w3.org/2004/06/rei#>.

skolem:proof a r:Proof, r:Conjunction;
    r:component skolem:lemma1;
    r:gives {
        (1 2 3 4 6 9 10 11 13) seq:answer "1-2-3-4, 6, 9-10-11, 13".
    }.

skolem:lemma1 a r:Inference;
    r:gives {
        (1 2 3 4 6 9 10 11 13) seq:answer "1-2-3-4, 6, 9-10-11, 13".
    };
    r:evidence (
        skolem:lemma2
        skolem:lemma3
        skolem:lemma4
        skolem:lemma5
    );
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_0"]; r:boundTo (1 2 3 4 6 9 10 11 13)];
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_1"]; r:boundTo (1 "-" 2 "-" 3 "-" 4 ", " 6 ", " 9 "-" 10 "-" 11 ", " 13)];
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_2"]; r:boundTo (1 "-" 2 "-" 3 "-" 4 ", " 6 ", " 9 "-" 10 "-" 11 ", " 13)];
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_3"]; r:boundTo (1 "-" 2 "-" 3 "-" 4 ", " 6 ", " 9 "-" 10 "-" 11)];
    r:rule skolem:lemma6.

skolem:lemma2 a r:Inference;
    r:gives {
        (1 2 3 4 6 9 10 11 13) seq:punctuate (1 "-" 2 "-" 3 "-" 4 ", " 6 ", " 9 "-" 10 "-" 11 ", " 13).
    };
    r:evidence (
        skolem:lemma7
        skolem:lemma8
        skolem:lemma9
        [ a r:Fact; r:gives {true log:callWithCut true}]
        skolem:lemma10
        skolem:lemma11
        skolem:lemma12
    );
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_0"]; r:boundTo (1 2 3 4 6 9 10 11 13)];
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_1"]; r:boundTo (1 "-" 2 "-" 3 "-" 4 ", " 6 ", " 9 "-" 10 "-" 11 ", " 13)];
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_2"]; r:boundTo 13];
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_3"]; r:boundTo (1 "-" 2 "-" 3 "-" 4 ", " 6 ", " 9 "-" 10 "-" 11 ", ")];
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_4"]; r:boundTo (13)];
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_5"]; r:boundTo (1 2 3 4 6 9 10 11)];
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_6"]; r:boundTo ()];
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_7"]; r:boundTo (1 2 3 4 6 9 10 11)];
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_8"]; r:boundTo (13)];
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_9"]; r:boundTo (1 2 3 4 6 9 10 11)];
    r:rule skolem:lemma13.

skolem:lemma3 a r:Inference;
    r:gives {
        (1 "-" 2 "-" 3 "-" 4 ", " 6 ", " 9 "-" 10 "-" 11 ", " 13) list:append (1 "-" 2 "-" 3 "-" 4 ", " 6 ", " 9 "-" 10 "-" 11 ", " 13).
    };
    r:evidence (
        [ a r:Fact; r:gives {{
            ?x_0 list:append ?x_0.
        }}]
    );
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_0"]; r:boundTo (1 "-" 2 "-" 3 "-" 4 ", " 6 ", " 9 "-" 10 "-" 11 ", " 13)];
    r:rule [ a r:Fact; r:gives {{
        @forAll x_0. {
            x_0 list:append x_0.
        } => {
            ?x_0 list:append ?x_0.
        }.
    }}].

skolem:lemma4 a r:Inference;
    r:gives {
        (1 "-" 2 "-" 3 "-" 4 ", " 6 ", " 9 "-" 10 "-" 11 (", ")) list:append (1 "-" 2 "-" 3 "-" 4 ", " 6 ", " 9 "-" 10 "-" 11 ", " 13).
    };
    r:evidence (
        [ a r:Fact; r:gives {{
            (?x_0 ?x_1) list:append (?x_0 ?x_1).
        }}]
    );
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_0"]; r:boundTo (1 "-" 2 "-" 3 "-" 4 ", " 6 ", " 9 "-" 10 "-" 11)];
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_1"]; r:boundTo (", " 13)];
    r:rule [ a r:Fact; r:gives {{
        @forAll x_0, x_1. {
            (?x_0 ?x_1) list:append (?x_0 ?x_1).
        } => {
            (?x_0 ?x_1) list:append (?x_0 ?x_1).
        }.
    }}].

skolem:lemma5 a r:Inference;
    r:gives {
        (1 "-" 2 "-" 3 "-" 4 ", " 6 ", " 9 "-" 10 "-" 11) string:concatenation "1-2-3-4, 6, 9-10-11".
    };
    r:evidence (
        [ a r:Fact; r:gives {{
            ?x_0 string:concatenation ?x_1.
        }}]
    );
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_0"]; r:boundTo (1 "-" 2 "-" 3 "-" 4 ", " 6 ", " 9 "-" 10 "-" 11)];
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_1"]; r:boundTo "1-2-3-4, 6, 9-10-11"];
    r:rule [ a r:Fact; r:gives {{
        @forAll x_0, x_1. {
            x_0 string:concatenation x_1.
        } => {
            ?x_0 string:concatenation ?x_1.
        }.
    }}].

skolem:lemma6 a r:Extraction;
    r:gives {
        @forAll var:x_0, var:x_1, var:x_2, var:x_3. {
            var:x_0 seq:punctuate var:x_1.
            var:x_1 list:append var:x_2.
            (var:x_3 (", ")) list:append var:x_2.
            var:x_3 string:concatenation var:x_4.
        } => {
            var:x_0 seq:answer var:x_4.
        }.
    };
    r:because [ a r:Parsing; r:source <https://raw.githubusercontent.com/eyereasoner/eye/master/reasoning/seq/seq_query.n3>].

skolem:lemma7 a r:Inference;
    r:gives {
        (1 "-" 2 "-" 3 "-" 4 ", " 6 ", " 9 "-" 10 "-" 11 ", " 13) e:firstRest (13 (1 "-" 2 "-" 3 "-" 4 ", " 6 ", " 9 "-" 10 "-" 11 ", ")).
    };
    r:evidence (
        [ a r:Fact; r:gives true]
        [ a r:Fact; r:gives {{
            (?x_0 ?x_1 ?x_2) e:firstRest (?x_0 ?x_1 ?x_2).
        }}]
    );
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_0"]; r:boundTo 13];
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_1"]; r:boundTo (1 "-" 2 "-" 3 "-" 4 ", " 6 ", " 9 "-" 10 "-" 11 ", ")];
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_2"]; r:boundTo ()];
    r:rule [ a r:Fact; r:gives {{
        @forAll x_0, x_1, x_2. {
            true.
            (?x_0 ?x_1 ?x_2) e:firstRest (?x_0 ?x_1 ?x_2).
        } => {
            (?x_0 ?x_1 ?x_2) e:firstRest (?x_0 ?x_1 ?x_2).
        }.
    }}].

skolem:lemma8 a r:Inference;
    r:gives {
        (13 1 2 3 4 6 9 10 11) func:reverse (1 2 3 4 6 9 10 11 13).
    };
    r:evidence (
        [ a r:Fact; r:gives {{
            ?x_0 func:reverse ?x_1.
        }}]
    );
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_0"]; r:boundTo (13 1 2 3 4 6 9 10 11)];
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_1"]; r:boundTo (1 2 3 4 6 9 10 11 13)];
    r:rule [ a r:Fact; r:gives {{
        @forAll x_0, x_1. {
            x_0 func:reverse x_1.
        } => {
            ?x_0 func:reverse ?x_1.
        }.
    }}].

skolem:lemma9 a r:Inference;
    r:gives {
        (13 (1 2 3 4 6 9 10 11)) list:append (13 1 2 3 4 6 9 10 11).
    };
    r:evidence (
        [ a r:Fact; r:gives {{
            (?x_0 ?x_1) list:append (?x_0 ?x_1).
        }}]
    );
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_0"]; r:boundTo (13)];
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_1"]; r:boundTo (1 2 3 4 6 9 10 11)];
    r:rule [ a r:Fact; r:gives {{
        @forAll x_0, x_1. {
            (?x_0 ?x_1) list:append (?x_0 ?x_1).
        } => {
            (?x_0 ?x_1) list:append (?x_0 ?x_1).
        }.
    }}].

skolem:lemma10 a r:Inference;
    r:gives {
        (1 2 3 4 6 9 10 11) seq:format (13).
    };
    r:evidence (
        [ a r:Fact; r:gives true]
        [ a r:Fact; r:gives {{
            (?x_0) seq:format (?x_0 ", ").
        }}]
    );
    r:binding [ r:variable [ n3:uri "http://www.w3.org/2000/10/swap/var#x_0"]; r:boundTo 13];
    r:rule [ a r:Fact; r:gives {{
        @forAll x_0. {
            true.
            (?x_0) seq:format (?x_0 ", ").
        } => {
            (?x_0) seq:format (?x_0 ", ").
        }.
    }}].

